import React from 'react'

export default class EnterNewTitle extends React.Component{
    constructor(){
        super()
    }
    render(){
        return (
            <div>
                <form>
                    <input type='text' placeholder='Enter the new title here...' />
                    <button>Save changes</button>
                </form>
            </div>
        )
    }
}
